import React, { Component } from "react";
import Link from "next/link";

class Detail extends Component{
    render(){
        const{title1 = "AOWSAY"} = this.props;
        return(               
            <div className="col-4 mr-3 shadow-sm p-4 mb-5 bg-dark rounded">
            <style jsx>{`
                Link {
                    color: black;
                    opacity: 0.5;
                }
            `}</style>
            <Link href={'/blog/detail'}><a>                    
                <img src="/static/images/products/1.png" className="img-fluid" />
                <hr/>                          
            </a></Link>
            <h4 className="text-center">{title1}</h4>
            </div>                         
        )
    }
}

export default Detail;
